// import transactions from '../components/transaction/transactions.json';

export const App = () => {
  return ( 
  <div className="App">
   { <Profile
  name={name}
  tag={tag}
  location={location}
  avatar={avatar}
  followers={stats.followers}
  views={stats.views}
  likes={stats.likes}
/>
}
</div>
  );
};
